/**
 *
 * n == nums.length
 * 1 <= n <= 105
 * 1 <= nums[i], k <= n
 * nums 中的整数互不相同
 *
 * @param nums
 * @param k
 */
function countSubarrays(nums: number[], k: number): number {
  const indexK = nums.findIndex(num => num === k)
  const n = nums.length
  const allLess = nums.reduce((count, num) => count += num < k ? 1 : 0, 0)
  const allGreater = nums.reduce((count, num) => count += num > k ? 1 : 0, 0)

  let res = 0
  const set = new Set()
  dfs(indexK, indexK, 0, 0, false, false)

  return res


  function dfs(leftIndex: number, rightIndex: number, less: number, greater: number, leftFlag: boolean, rightFlag: boolean) {
    if (leftIndex < 0 || rightIndex >= n)
      return
    if (less > n / 2 || greater > n / 2)
      return
    if (less > allLess || greater > allGreater)
      return
    if (set.has(`${leftIndex}_${rightIndex}`))
      return
    set.add(`${leftIndex}_${rightIndex}`)

    if (!leftFlag) {
      if (nums[leftIndex] > nums[indexK]) {
        greater++
      } else if (nums[leftIndex] < nums[indexK]) {
        less++
      }
    }
    if (!rightFlag) {
      if (nums[rightIndex] > nums[indexK]) {
        greater++
      } else if (nums[rightIndex] < nums[indexK]) {
        less++
      }
    }

    // 子长度为奇数
    if (less === greater)
      res++
    // 子长度为偶数
    if (less + 1 === greater)
      res++

    dfs(leftIndex - 1, rightIndex + 1, less, greater, false, false)
    dfs(leftIndex - 1, rightIndex, less, greater, false, true)
    dfs(leftIndex, rightIndex + 1, less, greater, true, false)
  }
}

